//SPDX-License-Identifier: MIT
pragma solidity ^0.8.11;

import "@openzeppelin/contracts/access/Ownable.sol";

contract TFTAirDrop is Ownable {
  uint public userCount;
  uint public maxUserCount = 1000;
  mapping(address => bool) public userList;

  constructor() {}

  function setMaxUserCount(uint _userCount) external onlyOwner {
    maxUserCount = _userCount;
  }

  function register() external {
    require(userList[msg.sender] == true, "Already registered user!");
    require(userCount + 1 <= maxUserCount, "Maximum user count excceedede!");
    userList[msg.sender] = true;
    userCount += 1;
  }
}
